import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

class main_nav extends Component {
  render() {
    return (
      <div>
        <div id="logo">
          <a><img src="/images/logo.png" alt="logo"></img></a>
        </div>
        <ul id="nav" className="nav justify-content-end">
            <li className="nav-item"><a href="./components/main">Projects</a></li>
            <li className="nav-item"><a href="#">NFTs</a></li>
            <li className="nav-item"><a href="#">NEWS</a></li>
            <li className="nav-item"><a href="#">ABOUT</a></li>
            <li className="nav-item"><a href="./components/contact">CONTACT</a></li>
        </ul>
      </div>
    );
  }
}

export default main_nav;
